const Admin = () => {
    const [brandVisible, setBrandVisible] = useState(false)

    return (
        <Container className="d-flex flex-column">
            <Button variant={"outline-dark"} className="mt-4">
                Добарити тип
            </Button>
            <Button variant={"outline-dark"} className="mt-4">
                Добавити бренд
            </Button>
            <Button variant={"outline-dark"} className="mt-4">
                Добавити пристрій
            </Button>
            <CreateBrand />
            <CreateDevice />
            <CreateType show={true}/>
        </Container>
    );
};

export default Admin;
